import React from "react";
import "./AboutMe.css";
import allc from "../assets/allc.png";
import androidstudio from "../assets/androidstudio.png";
import claymation_me from "../assets/claymation_me.png";
import dart from "../assets/dart.png";
import figma from "../assets/figma.png";
import flutter from "../assets/flutter.png";
import godot from "../assets/godot.png";
import java from "../assets/java.png";
import js from "../assets/js.png";
import linux from "../assets/linux.png";
import me from "../assets/me.png";
import postman from "../assets/postman.png";
import python from "../assets/python.png";
import swift from "../assets/swift.png";
import unity from "../assets/unity.png";
import vscode from "../assets/vscode.png";
import xcode from "../assets/xcode.png";

const AboutMe = () => {
  return (
    <section className="about-me">
      <div className="image-grid">
        {[allc, androidstudio, claymation_me, dart, figma, flutter, godot, java, js, linux, me, postman, python, swift, unity, vscode, xcode].map((img, index) => (
          <img key={index} src={img} alt={`Gallery ${index + 1}`} className="about-img" />
        ))}
      </div>
    </section>
  );
};

export default AboutMe;
